contracts/7_globalVariables.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

contract GlobalVariables {
    address public owner;
    address public Myblockhash;
    uint256 public difficulty;
    uint256 public gasLimit;
    uint256 public number;
    uint256 public timestamp;
    uint256 public value;
    uint256 public nowOn;
    address public origin;
    uint256 public gasprice;
    bytes public callData;
    bytes4 public Firstfour;

    constructor() {
        owner = msg.sender;
        // assigned value : 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4
        // account who deployed contract : 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4
        // Hence both same

        Myblockhash = block.coinbase;
        difficulty = block.difficulty;
        gasLimit = block.gaslimit;
        number = block.number;
        timestamp = block.timestamp;
        gasprice = tx.gasprice;
        origin = tx.origin;
        callData = msg.data;
        Firstfour = msg.sig;

        // value = msg.value;
        // nowOn = now;
    }
}

